Durant notre voyage au Mexique, nous avons fait le choix de séjourner à Puerto Juarez. C'est un lieu qui est un petit peu excentré de Cancun (2kms). 
.
L'avantage c'est que dans ce secteur, la foule était inexistante. D'ailleurs les locaux nous repéraient assez vite et nous interpellaient très souvent pour discuter ☺️
. 
Et le must, c'est qu'en nous réveillant le matin, nous avions  uniquement une route à traverser depuis notre hôtel pour rejoindre une sublime plage déserte... Comme dans un rêve 🤩 Pour ce qui est des déplacements, on avait recours très facilement aux bus et aux taxis. 
.
.
.
Qu'est-ce que vous avez prévu de beau pour ce week-end ? Et pour les chanceux qui étaient encore en vacances, ça a été la reprise ??
.
.
.
.
.
.
.
.
